import React from 'react';
import { Home } from 'features/common';
import { Route, Redirect, Switch } from 'react-router-dom'

function App() {
  return (
    <Switch>
      <Route exact path='/' component = { Home }/>
      <Redirect from='/home' to = { '/' }/>
    </Switch>
  );
}

export default App;
